INSERT INTO `kibugs-blog`.kb_blog (id, title, description, publish_status, customer_id, first_image_url, blog_type, appreciate_status, prise_status, category_id, delete_status, views, recommend, publish_time, create_time, update_time) VALUES (1, '标题', '昨天，35岁的表姐把我拉黑了。 表姐是医院有名的好护士，脾气好，耐心足，对谁都笑眯眯。 最近小半年，他们医院在搞评职称，指标之一就是护士的论文发布情况。 得知消息后，表姐开始着手发布职称论文，与此同时，我的噩梦也来了。 获得授权，非商业转载请注明出处。', 1, 1, 'https://picsum.photos/seed/picsum/800/450', 1, 1, 1, 1, 0, 123, 0, '2019-11-02 10:53:13', '2019-11-02 10:53:17', '2019-11-02 21:21:47');
